import { View, Text, Button, StyleSheet } from "react-native";
import { styles } from "../assets/estilos/alistyle";
import Icon from 'react-native-vector-icons/MaterialIcons'; 


export default function Opciones({navigation, route}) {
    const { nombreusuario} = route.params

    const ArrendarCarro = () => {
        navigation.navigate('Arrendarcar')
    }
    const RegistrarCarro = ()=> {
        navigation.navigate('RegistrarCar')
    }

    return (
        <View style={styles.container}>
            <Text style={styles.welcomeText}>Bienvenido, {nombreusuario}!</Text>
            <Text>Elige una opcion: </Text>
            <Button
                style={{ marginTop:10, backgroundColor: 'orage', width:200,height:60}}
                icon="car rental"
            >
                Alquilar Carro  
            </Button>
            <Button
                 style={{ marginTop: 20, backgroundColor: 'orange'}}
                 mode="contained"
                 icon=""
             >
                 Registrar Carro 
            </Button>
        </View>
    )
}
